public class InnerTemplateTemplateVersionDefinitionFactory(Action<Humidifier.QuickSight.TemplateTypes.TemplateVersionDefinition> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.TemplateTypes.TemplateVersionDefinition>
{

    internal InnerTemplateAssetOptionsFactory OptionsFactory { get; set; }

    internal InnerTemplateQueryExecutionOptionsFactory QueryExecutionOptionsFactory { get; set; }

    internal InnerTemplateAnalysisDefaultsFactory AnalysisDefaultsFactory { get; set; }

    protected override Humidifier.QuickSight.TemplateTypes.TemplateVersionDefinition Create()
    {
        var templateVersionDefinitionResult = CreateTemplateVersionDefinition();
        factoryAction?.Invoke(templateVersionDefinitionResult);

        return templateVersionDefinitionResult;
    }

    private Humidifier.QuickSight.TemplateTypes.TemplateVersionDefinition CreateTemplateVersionDefinition()
    {
        var templateVersionDefinitionResult = new Humidifier.QuickSight.TemplateTypes.TemplateVersionDefinition();

        return templateVersionDefinitionResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.TemplateTypes.TemplateVersionDefinition result)
    {
        base.CreateChildren(result);

        result.Options ??= OptionsFactory?.Build();
        result.QueryExecutionOptions ??= QueryExecutionOptionsFactory?.Build();
        result.AnalysisDefaults ??= AnalysisDefaultsFactory?.Build();
    }

} // End Of Class

